South Africa Revealed

Culture, Sociopolitical Documentary hosted by Andre Braugher and published by Discovery Channel broadcasted as part of DC Atlas series in 2007 - English narration


Information
------------------------------

South Africa Revealed explores the lives of several individuals and how they contribute in their own way to the new South Africa after years of internal struggle. Profiled is a young Zulu schoolgirl and her teacher, a man working thousands of feet underground in the world's deepest gold mine, a zoologist and her team working to preserve South Africa's unique wildlife, the Khoisan bushmen battling to keep their traditional way of life, a young colored woman in a leadership role in the South African Army, and an ambulance driver in Johannesburg, one of the world's most violent cities.

